import {Fragment } from "react";
import "./home.css";
function Home(){
    return <Fragment>
        <section id="home">
        <h1 className="heading-w">Go. Find. Explore.</h1>
        <h1 className="text-big-w">travelling made as easy as a walk in the park</h1>
        <button className="btn-lg-w">book now</button>
        </section>
    </Fragment>
}
export default Home
